<?php
require_once '../../logic/ImageObject.php';

class ImageObjectTest extends PHPUnit_Framework_TestCase 
{
	protected function setUp() 
	{
		
	}
	
	public function testConditionBase64()
	{
		$imageProcessor = new ImageObject();
		
		$result = '';
		
		$r = $imageProcessor->createFromBase64('data:image/png;base64,');
		
		$this->assertEquals($result, $r);
	}
	
	/**
	 * @expectedException InvalidArgumentException
	 */
	public function testBase64IsNotValid()
	{
		$imageProcessor = new ImageObject();
		$obj = $imageProcessor->createFromBase64('data:image/png;base64,&');
	}
	
	/**
	 * @expectedException InvalidArgumentException
	 */
	public function testErrorWhileConvertingImgB64ToBinary()
	{
		$imageProcessor = new ImageObject();
		$obj = $imageProcessor->createFromBase64('data:image/png;base64,&');
	}
	
	
}